        new webpack.HotModuleReplacementPlugin()
      ],
      module: {
        loaders: [{
          test: /\.jsx?$/,
          exclude: /node_modules/,
          loader: 'babel-loader',
          query: {
            presets: ['es2015', 'react']
          },
          include: path.join(__dirname, '.')
        }]
